import "./Styles/About.css";



function About () {
    return (

    <div className="about">


            <p className='aboutme'> Hi people, my name is Aly Kourouma. I'm a African American Muslim. I am currently in my fourth year of undergrad. I'm majoring in Computer Scienece. Throughout my four years in Computer Science 
             I learned C++, python, java, javascript,  I am specialized in doing data entries, analysis, budgets, and any other reports or financial enquires that our clients require.
             Along with my 2 years experience as an Office Manager in my company, I am graduating this spring for Computer Science major along with a Math minor. 
             I have always been passionate to code and create websites and I do love team works so I believe that I will be a great pleasure to working together
             <br/>
             <br/>

             </p>

        </div>

    );
}

export default About;
